Concurrent WriteConflict with MongoDB and NodeJs<p>I'm creating an application that serves transportation order, while I'm stress testing the application by injecting about 100 orders simultaneously, the mongodb hits WriteConflict due to the numeric sequence id (<strong>nid</strong> it is required) that I created using the hook. I have tried to add <code>?retryWrites=true&amp;w=majority</code> into the connection URI and set those in the transaction level, but none of those work. May I know any parts that I'm missing and should give a try (Knowing that is critical section, and using lock/queue should fix, but want to know any other way)? Thank you very much.</p>

<p>The schema for sequence and order (will keep _id that default created, and mongoose did the thing so haven't mention in the schema)</p>

<pre><code>const SequenceSchema = new Schema&lt;ISequenceDoc&gt;(
  {
    collectionName: {
      type: String,
      trim: true,
      required: true
    },
    nid: {
      type: Number,
      required: true
    }
  },
  {
    collection: 'sequences',
    timestamps: true
  }
);

const OrderSchema = new Schema&lt;IOrderDoc&gt;(
  {
    name: {
      type: String,
      trim: true,
      required: true
    },
    nid: {
      type: Number
    }
  },
  {
    collection: 'orders',
    timestamps: true
  }
);
</code></pre>

<p>Pre saving hook to assign an numeric id index of hex id to the schema</p>

<pre><code>OrderSchema.pre('save', async function(next) {
    if (this.isNew) {
      const data = await this.db.model&lt;ISequenceDoc&gt;('Sequence').findOneAndUpdate(
        {
          collectionName: this.collection.collectionName
        },
        {
          $inc: { nid: 1 }
        },
        {
          upsert: true,
          new: true,
          session: this.$session()
        }
      );
      this.set('nid', data.nid);
    }
    next();
});
</code></pre>

<p>The code that create the order model and save</p>

<pre><code>async createOrder(orderInfo) =&gt; {
const session = await this.connection.startSession();
session.startTransaction({
  readConcern: {
    level: 'majority'
  },
  writeConcern: {
    w: 'majority',
    j: true
  }
});
......
await order.save({session});
await session.commitTransaction();
return order;
}
</code></pre>

