<p>I'm able to convert this value to a datetime using the following aggregate:</p>

<pre><code>isodate = datetime.now()
pipeline = [
    {'$limit': 2},
    {'$project': { 
        'date':'$published_date',
        'date2': {
            '$dateFromString': {
                'dateString': '$published_date',
                }
            },
        }
    }
]
cursor = TEST_COLLECTION.aggregate(pipeline)
list(cursor)
</code></pre>

<p>where <code>date2</code> is the value converted to datetime (working already).
Now, the list of documents should be filtered such as the <code>date2 &gt;= isodate</code>
