<pre><code>'date2': { 
                '$filter': {
                    'input': {
                        '$dateFromString': {
                            'dateString': '$published_date',
                            }
                        },
                    'as': "date2",
                    'cond': { 
                        '$gte': ['$$date2', isodate] 
                        }
                    } 
                } 
