<pre><code>// Use the GoogleStrategy within Passport.
//   Strategies in passport require a `verify` function, which accept
//   credentials (in this case, a token, tokenSecret, and Google profile), and
//   invoke a callback with a user object.
passport.use(
    new GoogleStrategy({
        clientID: keys.google.clientID,
        clientSecret: keys.google.clientSecret,
        callbackURL: '/google/redirect'
    }, (accessToken, refreshToken, profile, done) =&gt; {
        console.log(profile);
        console.log(profile.displayName);
        console.log(profile.id);
        new Models.User({
            username: profile.displayName,
            googleID: profile.id,
            memberOf: null
            //console.log('got this far');
        }).save(console.log('got to the save')).then((newUser) =&gt; {
            console.log(newUser+'was created');
        });
        console.log('came down here');
    })
)
</code></pre>

<p>That is my implementation of <strong>passport</strong> and <strong>mongoose</strong>. Once I get the profile from Google I am trying to store that user's displayName and googleID in my <strong>User schema</strong> which I want to save to my DB. I'm not sure what I'm doing wrong but when I run this program I see that <strong>all</strong> the console.log's output to the terminal <code>**except**</code> for the <code>console.log(newUser+'was created');</code> in the <code>.then()</code> I was hoping someone could help me fix this issue.</p>

